I'm glad to hear you're interested in compiler optimization! Here are a few popular techniques along with simple examples to illustrate how they work:

1. **Constant Folding**: This technique replaces constant expressions with their computed values at compile time.

   *Example*:
   ```c
   int add(int a, int b) {
       return a + b;
   }

   int main() {
       int x = add(2, 3); // Before optimization
       // After constant folding:
       int x = 5;
   }
   ```

2. **Dead Code Elimination (DCE)**: DCE removes code that will never be executed or whose results are not used.

   *Example*:
   ```c
   int main() {
       int x = 10;
       int y = x + 5; // y is never used
       return x; // Return statement is dead code if the function is called without a return value
   }
   // After DCE:
   int main() {
       int x = 10;
       return x;
   }
   ```

3. **Common Subexpression Elimination (CSE)**: CSE replaces multiple occurrences of the same expression with a single computation.

   *Example*:
   ```c
   int main() {
       int a = 5, b = 10;
       int x = a + b; // x = 15
       int y = a + b; // y = 15
   }
   // After CSE:
   int main() {
       int a = 5, b = 10;
       int x = a + b; // x = 15
       int y = x; // y = 15
   }
   ```

4. **Loop Optimization - Loop Unrolling**: Loop unrolling reduces the overhead of loop control code by replicating the loop body multiple times.

